import { Link } from "react-router-dom";
import classes from "./Landing.module.css"

function Landing() {
  return (
    <div>
      <div className={classes.difficulty}>
          Beginner
      </div>
      <div className={classes.difficulty}>
          Intermediate
      </div>
      <div className={classes.difficulty}>
          Masochistic
      </div>
    </div>
  );
}

export default Landing;
